import styles from './styles.module.scss';
import Link from 'next/link';
import Button from '../../shared/button'


function Thanks({
    text,
    action
}) {
    return(
        <>
            <div className={styles.bottom_note}>
                <div className={styles.text}>
                    {text}
                </div>
                {action}
            </div>
        </>
    )
}

export default Thanks;
